import React from 'react';
import { NavLink } from 'react-router-dom';


const Menu = ()=>{
    return (
        <div className='menu_style'>
        <NavLink exact activeClassName="active_class" to="/">AboutUS</NavLink>
        <NavLink exact activeClassName="active_class" to="/service">ServiceUS</NavLink>
        <NavLink exact activeClassName="active_class" to="/search">ServiceUS</NavLink>
        <NavLink exact activeClassName="active_class" to="/user">User</NavLink>
        <NavLink exact activeClassName="active_class" to="/contact">ContactUS</NavLink>
        {/* <br />
            <a href='/' >AboutUs</a> 
            <a href='/contact' >contactUs</a>  */}
        </div>
    )
}
export default Menu;
